import './App.css';
import theImage from './img/wpis1.jpg'

function Card(props) {
    return (
        <main className='container-fluid'>
            <div className='card-blog' style='{background-image: url({theImage})}'>
                <div className='card-blog-left'>
                    <h3>{props.title}</h3>
                    <p className='card-blog-text'>{props.description}</p>
                </div>
                
            </div>
        </main>
    );
}

export default Card;
